import React, { Component } from "react";
import "./Profile.scss";
import profile from "../../../Assets/image/profile.jpg";
import { connect } from "react-redux";
// import { setUserData } from "../../../Actions";

class Profile extends Component {
  state = {
    firstName: "",
    lastName: "",
  };
  componentWillReceiveProps(nextProps) {
    if (this.props.profileData !== nextProps.profileData) {
      console.log(nextProps.profileData);
      // nextProps.profileData.map((data, index) => {
      //   console.log(data, "555555");
      //   this.setState({
      //     firstName: data.firstName,
      //     lastName: data.lastName,
      //   });
      // });
    }
  }
  render() {
    const { firstName, lastName } = this.state;
    console.log(firstName);
    console.log(this.props.profileData.firstName);
    return (
      <div className="row section">
        <div className="col-xl-10 mx-auto">
          <div className="row">
            {/* <div className="col-xl-4 col-md-5">
              <div className="card h-auto" style={{ background: "#343a40" }}>
                <div className="card-body text-center">
                  <div className="avatar avatar-xl avatar-circle mx-auto mb-4">
                    <img src={profile} alt="user-image" />
                  </div>
                  <h6 className="mb-3" style={{ color: "#adb5bd" }}>
                    Hallo Admin
                  </h6>
                  <button type="button" className="btn btn-danger btn-air">
                    Change Image
                  </button>
                </div>
              </div>
            </div> */}
            <div className="col-xl-12 col-md-12">
              <div className="card h-auto" style={{ background: "#343a40" }}>
                <div className="card-body">
                  <form action="#" className="row">
                    <div className="col-xl-6 form-group">
                      <label
                        htmlFor="firstName"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        First Name :
                      </label>
                      <label
                        htmlFor="Name"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        {this.props.profileData.firstName}
                      </label>{" "}
                    </div>
                    <div className="col-12 form-group">
                      <label
                        htmlFor="lastName"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        Last Name :
                      </label>
                      <label
                        htmlFor="lastName"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        {this.props.profileData.lastName}
                      </label>
                    </div>
                    <div className="col-12 form-group">
                      <label
                        htmlFor="dispName"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        Display Name :
                      </label>
                      <label
                        htmlFor="dispName"
                        className="form-label"
                        style={{ color: "#adb5bd" }}
                      >
                        {this.props.profileData.firstName +
                          " " +
                          this.props.profileData.lastName}
                      </label>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const MapStateToProps = (state) => ({
  profileData: state.auth.userData,
});

export default connect(MapStateToProps)(Profile);
